import React, { Component } from 'react';
import SingleItem from './components/singleItem';

import {Grid, Row, Col} from 'react-bootstrap';

class App extends Component {

  render() {
    return (
      <div className="App">
        <Grid>
          <Row>
            <Col md={6} mdOffset={3}>
              <SingleItem />
            </Col>
          </Row>
        </Grid>
      </div>
    );
  }
}

export default App;
